import execjs


def get_ciphertext():
    with open('wenshu/wenshu_js.js') as f:
        js = f.read()

    js_ctx = execjs.compile(js)
    ciphertext = js_ctx.call('cipher')
    return ciphertext


def decrypt_res(result, secretKey):
    with open('wenshu/wenshu_js.js') as f:
        js = f.read()

    js_ctx = execjs.compile(js)
    ciphertext = js_ctx.call('decrypt', result, secretKey, '')
    return ciphertext

